import React from 'react';
import Navbar from '../Navbar/Navbar';
import './Contactus.css';
import Footer from '../Footer/Footer';


function Contactus() {
  return (
    <div className="contactus-container">
      <Navbar />
      <h1>Contactanos</h1>

      <span>Contactanos</span>

      <Footer />
    </div>
  );
}

export default Contactus;
